  body: You hear yourself gasp, unsure if it's what woke you or if it were just a
    symptom of the cause. You awake as you had plenty of mornings prior - sweating,
    short of breath, hands shielding face. It takes a moment to calm yourself, staring
    at the high ceiling trying to erase the moment from your memory. You find it easier
    to think of the day ahead to erase the past and it is just enough to rouse you
    to your feet. You look about the small, stately room. The windows wooden shutters
    blocking the view. The breeze behind is just enough to steal through the slats
    and a sheaf of papers rustle in response. Your feet hit the cool tile floor. What
    do you always do first thing in the morning?
